MONSTERS

Source: Aired on Magnolia Pictures Channel (on-demand) on Sept 24th, and will be in theaters on Oct 29.

Storyline:
Six years ago NASA discovered the possibility of alien life within our solar system. A probe was launched to collect samples, but crashed upon re-entry over Central America. Soon after, new life form began to appear and half of Mexico was quarantined as an INFECTED ZONE. Today, the American and Mexican military still struggle to contain &quot;the creatures&quot;...... Our story begins when a US journalist agrees to escort a shaken tourist through the infected zone in Mexico to the safety of the US border.

Cast:
Whitney Able - Samantha Wynden
Scoot McNairy - Andrew Kaulder

Director: Gareth Edwards
Writer: Gareth Edwards
